import React from 'react'
import {Form } from 'antd'
const LoginForm = () => {
    return (
        <Form>
            <div>
                <label htmlFor='user-id'>ID</label>
            </div>
            <div></div>
            <div></div>
            <div></div>
        </Form>
    );
}

export default LoginForm
